  const { loginWithRedirect } = useAuth0();
  return (
    <button
      className={className}
      onClick={() => loginWithRedirect()}
    >
      <i className="fas fa-sign-in-alt fa-sm fa-fw mr-2 text-gray-400" />
      Iniciar sesi√≥n
    </button>
  );
};

export default LoginButton;
